Rather than write down the equations ourselves, we will rely on the PyBaMM library to generate the equations for us. PyBaMM is a Python library that can generate a wide variety of physics-based battery models, using different parameterisations, physics and operating conditions. Combined with a tool that takes a PyBaMM model and writes it out in the DiffSL language, we can generate a DiffSL file that can be used to solve the equations of the SPM model described above. We can then use the DiffSol crate to solve the model and calculate the terminal voltage of the battery over a range of current rates. The code below reads in the DiffSL file, compiles it, and then solves the equation for different current rates. We wish to stop the simulation when either the final time is reached, or when one of the stopping conditions is met. We will output the terminal voltage of the battery at regular intervals during the simulation, because the terminal voltage can change more rapidly than the state variables $c_n$ and $c_p$, particularly during the "knee" of the discharge curve. The discretised equations result in sparse matrices, so we use the sparse matrix and linear solver modules provided by the faer crate to solve the equations efficiently. use diffsol::{ DiffSl, OdeBuilder, CraneliftModule, SparseColMat, FaerSparseLU, OdeSolverMethod, OdeSolverStopReason, OdeEquations, NonLinearOp,
};
use plotly::{ Plot, Scatter, common::Mode, layout::Layout, layout::Axis
};
# use std::fs;
# fn main() {
type M = SparseColMat<f64>;
type LS = FaerSparseLU<f64>;
type CG = CraneliftModule; let file = std::fs::read_to_string("../src/primer/src/spm.ds").unwrap(); let eqn = DiffSl::<M, CG>::compile(&file).unwrap();
let mut problem = OdeBuilder::<M>::new() .p([1.0]) .build_from_eqn(eqn) .unwrap();
let currents = vec![0.6, 0.8, 1.0, 1.2, 1.4];
let final_time = 3600.0;
let delta_t = 3.0; let mut plot = Plot::new();
for current in currents { problem.eqn.set_params(&faer::Col::from_fn(1, |_| current)); let mut solver = problem.bdf::<LS>().unwrap(); let mut v = Vec::new(); let mut t = Vec::new(); // save the initial output let mut out = problem.eqn.out().unwrap().call(solver.state().y, solver.state().t); v.push(out[0]); t.push(0.0); // solve until the final time is reached // or we reach the stop condition solver.set_stop_time(final_time).unwrap(); let mut next_output_time = delta_t; let mut finished = false; while !finished { let curr_t = match solver.step() { Ok(OdeSolverStopReason::InternalTimestep) => solver.state().t, Ok(OdeSolverStopReason::RootFound(t)) => { finished = true; t }, Ok(OdeSolverStopReason::TstopReached) => { finished = true; final_time }, Err(_) => panic!("unexpected solver error"), }; while curr_t > next_output_time { let y = solver.interpolate(next_output_time).unwrap(); problem.eqn.out().unwrap().call_inplace(&y, next_output_time, &mut out); v.push(out[0]); t.push(next_output_time); next_output_time += delta_t; } } let voltage = Scatter::new(t, v) .mode(Mode::Lines) .name(format!("current = {} A", current)); plot.add_trace(voltage);
} let layout = Layout::new() .x_axis(Axis::new().title("t [sec]")) .y_axis(Axis::new().title("voltage [V]"));
plot.set_layout(layout);
let plot_html = plot.to_inline_html(Some("battery-simulation"));
# fs::write("../src/primer/images/battery-simulation.html", plot_html).expect("Unable to write file");
# }

