Using the logistic example, we can add a root finding function \(r(y, p, t)\) that will stop the solver when the value of \(y\) is such that \(r(y, p, t) = 0\). For this example we'll use the root finding function \(r(y, p, t) = y - 0.5\), which will stop the solver when the value of \(y\) is 0.5. \[\frac{dy}{dt} = r y (1 - y/K),\] \[r(y, p, t) = y - 0.5,\] This can be done using the OdeBuilder via the following code: # fn main() {
use diffsol::OdeBuilder;
use nalgebra::DVector;
type M = nalgebra::DMatrix<f64>; let problem = OdeBuilder::<M>::new() .t0(0.0) .rtol(1e-6) .atol([1e-6]) .p(vec![1.0, 10.0]) .rhs_implicit( |x, p, _t, y| y[0] = p[0] * x[0] * (1.0 - x[0] / p[1]), |x, p, _t, v , y| y[0] = p[0] * v[0] * (1.0 - 2.0 * x[0] / p[1]), ) .init(|_p, _t| DVector::from_element(1, 0.1)) .root(|x, _p, _t, y| y[0] = x[0] - 0.5, 1) .build() .unwrap();
# } here we have added the root finding function \(r(y, p, t) = y - 0.5\), and also let DiffSol know that we have one root function by passing 1 as the last argument to the root method. If we had specified more than one root function, the solver would stop when any of the root functions are zero.

