We will again use the example of the logistic growth equation, but this time we will compute the sensitivity of the solution \(y\) with respect to the parameters \(r\) and \(K\) (i.e. \(\frac{dy}{dr}\) and \(\frac{dy}{dK}\)). The logistic growth equation is: \[\frac{dy}{dt} = r y (1 - y/K),\] \[y(0) = 0.1\] Recall from ODE equations that we also need to provide the jacobian of the right hand side of the ODE with respect to the state vector \(y\) and the gradient vector \(v\), which we will call \(J\). This is: \[J v = \begin{bmatrix} r v (1 - 2 y/K) \end{bmatrix}.\] Using the logistic growth equation above, we can compute the partial derivative of the right hand side of the ODE with respect to the vector \([r, K]\) multiplied by a vector \(v = [v_r, v_K]\), which we will call \(J_p v\). This is: \[J_p v = v_r y (1 - y/K) + v_K r y^2 / K^2 .\] We also need the partial derivative of the initial state vector with respect to the parameters multiplied by a vector \(v\), which we will call \(J_{y_0} v\). Since the initial state vector is constant, this is just zero \[J_{y_0} v = 0.\] We can then use the OdeBuilder struct to specify the sensitivity problem. The rhs_sens_implicit and init_sens methods are used to create a new problem that includes the sensitivity equations. # fn main() {
use diffsol::OdeBuilder;
use nalgebra::DVector;
type M = nalgebra::DMatrix<f64>; let problem = OdeBuilder::<M>::new() .p(vec![1.0, 10.0]) .rhs_sens_implicit( |x, p, _t, y| y[0] = p[0] * x[0] * (1.0 - x[0] / p[1]), |x, p, _t, v , y| y[0] = p[0] * v[0] * (1.0 - 2.0 * x[0] / p[1]), |x, p, _t, v, y| y[0] = v[0] * x[0] * (1.0 - x[0] / p[1]) + v[1] * p[0] * x[0] * x[0] / (p[1] * p[1]), ) .init_sens( |_p, _t| DVector::from_element(1, 0.1), |_p, _t, _v, y| y[0] = 0.0, ) .build() .unwrap();
# }

