Once the sensitivity problem has been specified, we can solve it using the OdeSolverMethod trait. Lets imagine we want to solve the sensitivity problem up to a time \(t_o = 10\). We can use the OdeSolverMethod trait to solve the problem as normal, stepping forward in time until we reach \(t_o\). # fn main() {
# use diffsol::OdeBuilder;
# use nalgebra::DVector;
# type M = nalgebra::DMatrix<f64>;
use diffsol::{OdeSolverMethod, NalgebraLU};
type LS = NalgebraLU<f64>; # let problem = OdeBuilder::<M>::new()
# .p(vec![1.0, 10.0])
# .rhs_sens_implicit(
# |x, p, _t, y| y[0] = p[0] * x[0] * (1.0 - x[0] / p[1]),
# |x, p, _t, v , y| y[0] = p[0] * v[0] * (1.0 - 2.0 * x[0] / p[1]),
# |x, p, _t, v, y| y[0] = v[0] * x[0] * (1.0 - x[0] / p[1]) # + v[1] * p[0] * x[0] * x[0] / (p[1] * p[1]),
# )
# .init_sens(
# |_p, _t| DVector::from_element(1, 0.1),
# |_p, _t, _v, y| y[0] = 0.0,
# )
# .build()
# .unwrap();
let mut solver = problem.bdf::<LS>().unwrap();
let t_o = 10.0;
while solver.state().t < t_o { solver.step().unwrap();
}
# } We can then obtain the sensitivity vectors at time \(t_o\) using the interpolate_sens method on the OdeSolverMethod trait. This method returns a Vec<DVector<f64>> where each element of the vector is the sensitivity vector for element \(i\) of the parameter vector at time \(t_o\). If we need the sensitivity at the current internal time step, we can get this from the s field of the OdeSolverState struct. # fn main() {
# use diffsol::OdeBuilder;
# use nalgebra::DVector;
# type M = nalgebra::DMatrix<f64>;
# use diffsol::{OdeSolverMethod, OdeSolverState, NalgebraLU};
# type LS = NalgebraLU<f64>;
# # let problem = OdeBuilder::<M>::new()
