struct MyMass<'a> { p: &'a V } // implements LinearOp
struct MyInit<'a> { p: &'a V } // implements ConstantOp
struct MyRoot<'a> { p: &'a V } // implements NonLinearOp
struct MyOut<'a> { p: &'a V } // implements NonLinearOp
# }

