DiffSol has a few high-level solution functions on the OdeSolverMethod trait that are the easiest way to solve your equations: solve - solve the problem from an initial state up to a specified time, returning the solution at all the internal timesteps used by the solver. solve_dense - solve the problem from an initial state, returning the solution at a Vec of times provided by the user. ['solve_dense_sensitivities](https://docs.rs/diffsol/latest/diffsol/ode_solver/method/trait.OdeSolverMethod.html#method.solve_dense_sensitivities) - solve the forward sensitivity problem from an initial state, returning the solution at a Vec` of times provided by the user. 'solve_adjoint' - solve the adjoint sensitivity problem from an initial state to a final time, returning the integration of the output function over time as well as its gradient with respect to the initial state. The following example shows how to solve a simple ODE problem using the solve method on the OdeSolverMethod trait. # use diffsol::OdeBuilder;
