The field of Pharmacokinetics (PK) provides a quantitative basis for describing the delivery of a drug to a patient, the diffusion of that drug through the plasma/body tissue, and the subsequent clearance of the drug from the patient's system. PK is used to ensure that there is sufficient concentration of the drug to maintain the required efficacy of the drug, while ensuring that the concentration levels remain below the toxic threshold. Pharmacokinetic (PK) models are often combined with Pharmacodynamic (PD) models, which model the positive effects of the drug, such as the binding of a drug to the biological target, and/or undesirable side effects, to form a full PKPD model of the drug-body interaction. This example will only focus on PK, neglecting the interaction with a PD model. Fig 1 PK enables the following processes to be quantified: Absorption Distribution Metabolism Excretion These are often referred to as ADME, and taken together describe the drug concentration in the body when medicine is prescribed. These ADME processes are typically described by zeroth-order or first-order rate reactions modelling the dynamics of the quantity of drug $q$, with a given rate parameter $k$, for example: \[ \frac{dq}{dt} = -k^*, \] \[ \frac{dq}{dt} = -k q. \] The body itself is modelled as one or more compartments , each of which is defined as a kinetically homogeneous unit (these compartments do not relate to specific organs in the body, unlike Physiologically based pharmacokinetic, PBPK, modeling). There is typically a main central compartment into which the drug is administered and from which the drug is excreted from the body, combined with zero or more peripheral compartments to which the drug can be distributed to/from the central compartment (See Fig 2). Each peripheral compartment is only connected to the central compartment. Fig 2 The following example PK model describes the two-compartment model shown diagrammatically in the figure above. The time-dependent variables to be solved are the drug quantity in the central and peripheral compartments, $q_c$ and $q_{p1}$ (units: [ng]) respectively. \[ \frac{dq_c}{dt} = \text{Dose}(t) - \frac{q_c}{V_c} CL - Q_{p1} \left ( \frac{q_c}{V_c} - \frac{q_{p1}}{V_{p1}} \right ), \] \[ \frac{dq_{p1}}{dt} = Q_{p1} \left ( \frac{q_c}{V_c} - \frac{q_{p1}}{V_{p1}} \right ). \] This model describes an intravenous bolus dosing protocol, with a linear clearance from the central compartment (non-linear clearance processes are also possible, but not considered here). The dose function $\text{Dose}(t)$ will consist of instantaneous doses of $X$ ng of the drug at one or more time points. The other input parameters to the model are: \(V_c\) [mL], the volume of the central compartment \(V_{p1}\) [mL], the volume of the first peripheral compartment \(CL\) [mL/h], the clearance/elimination rate from the central compartment \(Q_{p1}\) [mL/h], the transition rate between central compartment and peripheral compartment 1 We will solve this system of ODEs using the DiffSol crate. Rather than trying to write down the dose function as a mathematical function, we will neglect the dose function from the equations and instead using DiffSol's API to specify the dose at specific time points. First lets write down the equations in the standard form of a first order ODE system: \[ \frac{d\mathbf{y}}{dt} = \mathbf{f}(\mathbf{y}, t) \] where \[ \mathbf{y} = \begin{bmatrix} q_c \\ q_{p1} \end{bmatrix} \] and \[ \mathbf{f}(\mathbf{y}, t) = \begin{bmatrix} - \frac{q_c}{V_c} CL - Q_{p1} \left ( \frac{q_c}{V_c} - \frac{q_{p1}}{V_{p1}} \right ) \\ Q_{p1} \left ( \frac{q_c}{V_c} - \frac{q_{p1}}{V_{p1}} \right ) \end{bmatrix} \] We will also need to specify the initial conditions for the system: \[ \mathbf{y}(0) = \begin{bmatrix} 0 \\ 0 \end{bmatrix} \] For the dose function, we will specify a dose of 1000 ng at regular intervals of 6 hours. We will also specify the other parameters of the model: \[ V_c = 1000 \text{ mL}, \quad V_{p1} = 1000 \text{ mL}, \quad CL = 100 \text{ mL/h}, \quad Q_{p1} = 50 \text{ mL/h} \] Let's now solve this system of ODEs using DiffSol. # fn main() {
# use std::fs;
use diffsol::{ DiffSl, CraneliftModule, OdeBuilder, OdeSolverMethod, OdeSolverStopReason,
};
use plotly::{ Plot, Scatter, common::Mode, layout::Layout, layout::Axis
};
type M = nalgebra::DMatrix<f64>;
type CG = CraneliftModule;
type LS = diffsol::NalgebraLU<f64>; let eqn = DiffSl::<M, CG>::compile(" Vc { 1000.0 } Vp1 { 1000.0 } CL { 100.0 } Qp1 { 50.0 } u_i { qc = 0, qp1 = 0, } F_i { - qc / Vc * CL - Qp1 * (qc / Vc - qp1 / Vp1), Qp1 * (qc / Vc - qp1 / Vp1), }
").unwrap(); let problem = OdeBuilder::<M>::new().build_from_eqn(eqn).unwrap();
let mut solver = problem.bdf::<LS>().unwrap();
let doses = vec![(0.0, 1000.0), (6.0, 1000.0), (12.0, 1000.0), (18.0, 1000.0)]; let mut q_c = Vec::new();
let mut q_p1 = Vec::new();
let mut time = Vec::new(); // apply the first dose and save the initial state
solver.state_mut().y[0] = doses[0].1;
q_c.push(solver.state().y[0]);
q_p1.push(solver.state().y[1]);
time.push(0.0); // solve and apply the remaining doses
for (t, dose) in doses.into_iter().skip(1) { solver.set_stop_time(t).unwrap(); loop { let ret = solver.step(); q_c.push(solver.state().y[0]); q_p1.push(solver.state().y[1]); time.push(solver.state().t); match ret { Ok(OdeSolverStopReason::InternalTimestep) => continue, Ok(OdeSolverStopReason::TstopReached) => break, _ => panic!("unexpected solver error"), } } solver.state_mut().y[0] += dose;
}
let mut plot = Plot::new();
let q_c = Scatter::new(time.clone(), q_c).mode(Mode::Lines).name("q_c");
let q_p1 = Scatter::new(time, q_p1).mode(Mode::Lines).name("q_p1");
plot.add_trace(q_c);
plot.add_trace(q_p1); let layout = Layout::new() .x_axis(Axis::new().title("t [h]")) .y_axis(Axis::new().title("amount [ng]"));
plot.set_layout(layout);
let plot_html = plot.to_inline_html(Some("drug-delivery"));
# fs::write("../src/primer/images/drug-delivery.html", plot_html).expect("Unable to write file");
# }

